func generateBenchData() [][]string {
	data := make([][]string, len(BENCH_KEY_SETS))
	for i, set := range BENCH_KEY_SETS {
		data[i] = make([]string, len(set))
		for j, idx := range set {
			data[i][j] = BENCH_KEYS[idx]
		}
	}
	return data
}

func accumulate(keys []string) pcommon.Map {
	m := pcommon.NewMap()
	m.EnsureCapacity(len(keys))

	slices.Sort(keys)

	var prevKey string
	var streak int
	var curSlot pcommon.Value
	for _, key := range keys {
		duplicate := streak > 0 && key == prevKey
		if streak == 1 {
			if duplicate {
				slice := curSlot.SetEmptySlice()
				slice.EnsureCapacity(3)
				slice.AppendEmpty().SetStr(BENCH_VAL)
			} else {
				curSlot.SetStr(BENCH_VAL)
			}
		}
		if duplicate {
			curSlot.Slice().AppendEmpty().SetStr(BENCH_VAL)
			streak++
		} else {
			curSlot = m.PutEmpty(key)
			streak = 1
		}
		prevKey = key
	}
	if streak == 1 {
		curSlot.SetStr(BENCH_VAL)
	}
	return m
}

