func TestOriginal(t *testing.T) {
	data := generateBenchData()
	for _, keys := range data {
		keyCount := map[string]int{}
		for _, k := range keys {
			keyCount[k]++
		}

		m := accumulate(keys)
		for k, v := range m.All() {
			count := 1
			if v.Type() == pcommon.ValueTypeSlice {
				count = v.Slice().Len()
			}
			if count != keyCount[k] {
				t.FailNow()
			}
		}
		for k := range keyCount {
			if _, ok := m.Get(k); !ok {
				t.FailNow()
			}
		}
	}
}

func TestMapRemove(t *testing.T) {
	m := pcommon.NewMap()
	m.PutStr("a", "a")
	m.PutStr("b", "b")
	m.PutStr("c", "c")

	va, ok := m.Get("a")
	assert.True(t, ok)
	vc, ok := m.Get("c")
	assert.True(t, ok)

	assert.Equal(t, "a", va.Str())
	assert.Equal(t, "c", vc.Str())

	m.Remove("a")

	assert.Equal(t, "c", va.Str())
	assert.Equal(t, "c", vc.Str())

	m.PutStr("d", "d")

	assert.Equal(t, "c", va.Str())
	assert.Equal(t, "d", vc.Str())
}
